script: |
  super -f text -I q3181.spq | sort > q3181.out

inputs:
  - name: q3181.spq
    data: |
      SELECT ALL CAST ( - + col1 AS INTEGER ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN - col2 AND ( + + col1 / - col2 * col2 / + col2 + - col2 );
  - name: tab2

outputs:
  - name: q3181.out
    data: |
